import React from 'react';
import './Projects.css';

const Projects = () => {
  return (
    <section id="projects" className="projects">
      <div className="container">
        <h2>Projects</h2>
        <p>Details about your projects.</p>
      </div>
    </section>
  );
};

export default Projects;
